import { Component } from '@angular/core';

@Component({
  selector: 'app-home1',
  templateUrl: './home1.component.html',
  styleUrls: ['./home1.component.css']
})
export class Home1Component {

}
<p>estamos na home</p>
<button routerLink="/personagens">personagens</button>
<button routerLink="/contato">contatos</button>
<button routerLink="/info">info</button>
